import logo from './logo.svg';
import React, { useState } from 'react';
import './App.css';


function Greeting(props){
  return (
    <h1> 안녕하세요. {props.name}입니다.</h1>
  );
}


function App() {
  let [count, setCount] = useState(0); // 초기값0을 가진 count state생성, 변경함수는 setCount()
  let [text, setText] = useState('');
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <Greeting name="신다은" />
        <input type="text" valuse={text} onChange={(e)=> setText(e.target.value)}></input>
        <p>
          입력한 텍스트 결과 : {text}
        </p>
        <div>
          <p>현재 좋아요 수 : {count}</p>
          <button onClick={()=>setCount(count+1)}>좋아요</button>
          <button onClick={()=>setCount(count-1)}>싫어요</button>
        </div>
      </header>
    </div>
  );
}

export default App;
